:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Thomas Coldham and BEETHAM, Anne Palmer (Annie)
  WILLIAMS, Eila Mabel and REED, Vernon Herbert
  09> WILLIAMS, Eila Mabel m on 28.04.1909 to REED, Vernon Herbert
  b 03.02.1876 d 06.06.1959
  b 07.05.1871 d 26.05.1963
  Eila b. at Hutt. Vernon, s/o George McCullogh Reed and Jessie Chalmers Ranken, b. at North Shore, Auckland.
  Vernon was Member of Parliament for the Bay of Islands and later a member of the Legislative Council. He was
  instrumental in interesting Lord Bledisloe in purchasing the Waitangi Estate and establishing the Waitangi
  National Trust. Bledisloe bought the property and presented it to the Nation. Vernon became Honorary
  Administrator of the Trust and was the author of "The Gift of Waitangi".
  Eila was a noted artist and in particular, a watercolourist and as a young woman she studied at Bruges and
  Paris.
  01> REED, Thomas Walton m on ** **, 1944 to HENDERSON, Hannah Eleanor Evelyn
  b 06.12.1910.
  b 04.12.1921 d 09.12.1995
  Thomas b. at Wellington and m, at Edinburgh, Scotland. Hannah, d/o William Smith Ramsay
  Henderson and Hannah Hamilton Marshall Lang. Address: Paihia, Bay of Islands.
  Thomas was educated at Wanganui Collegiate School and Cambridge University. He and Hannah
  were farmers.
  01> REED, Judith Mary m on 23.05.1970 to CROPPER, Nicholas
  b 25.10.1947
  b 27.01.1947
  Judith b. at Kaitaia and m, at Paihia. Nicholas, s/o J W Cropper and N F Hooker, b. at Auckland.
  Address: 214 Victoria Avenue, Remuera, Auckland.
  Nicholas is an engineer.
  01> CROPPER, James Nicholas
  b 27.03.1974
  James b. at Auckland. He was educated at King's School in Auckland and Wanganui Collegiate School
  then graduated from Massey University with a Diploma of Horticulture and a Bachelor of Applied
  Science. He is now working for Montana Wines in Hawkes Bay.
  02> CROPPER, Samuel Charles
  b 01.03.1976
  Samuel b. at Auckland. He was educated at King's School in Auckland and Wanganui Collegiate School
  where he was a school prefect and a crew member of the 1st rowing VIII. He is now studying towards
  a BSc at Massey University.
  02> REED, Kirsty Evelyn m on ** ** **** to MCGILL, Ian William
  b 13.05.1951
  b 29.03.1939
  Kirsty b. at Kawakawa. Address: 27 Martin Avenue, Remuera, Auckland.
  Kirsty was educated at Woodford House then trained as a kindergarten teacher. After leaving school,
  she did further course at Auckland Technical Institute in the secretarial and marketing fields. She is
  presently working part-time in a private pre-school.
  Ian is a business consultant.
  03> REED, Vernon David Lang m on 02.12.1988 to COOK, Mary Ann
  b 09.09.1955
  b 08.06.1960
  Address: 48a Godden Crescent, Mission Bay, Auckland.
  David was educated at King's Prep School and Wanganui Collegiate School and has an accountancy degree
  from Auckland Institute of Technology. He is a director of a Far North milk company, Topmilk Ltd, and
  of Fairlawn Farms.
  Mary Ann was educated at Diocesan School and has a BA.
  01> REED, Thomas Matthew Lang
  b 21.08.1990
